import React from 'react';
import Header from './header';
import Content from './content';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const arraySkills = ['npm', 'jest', 
'front-end'];
const skillsMap = arraySkills.map((skill) => <li>{skill}</li>);

class App extends React.Component {
  render() {
    return <div>
      <Header />
      <ul>
        <li>{Task('React')}</li>
        {skillsMap}
      </ul>
    </div>

  }
}

export default App;
